import React from 'react'
import trade from "../assets/trade (1).png"
const Signup = () => {
  return (
    <div className= "signup">
        <div className ="container">
            {/* left */}
            <div className = "left">
                <img  src={trade} alt= "trade"></img>
            </div>
            {/* right */}
            <div className ="right">
                <h2>Earn passive income with crypto.</h2>
                <p>Earn up to 12%  </p>
            </div>
        </div>

    </div>
  )
}

export default Signup
